DROP TABLE if exists cargo;
create table cargo (
	cargoID INT,
	cargoDate DATE,
	cargoWeight INT,
	cargoGoodsClass INT,
	cargoDangerousGoods VARCHAR(3),
	cargoDangerousGoodsClassification VARCHAR(25),
	imoNo INT,
	dockID INT,
	crewID INT,
    PRIMARY KEY(cargoID),
    FOREIGN KEY(imoNo) REFERENCES ship(imoNo),
    FOREIGN KEY(dockID) REFERENCES dock(dockID),
    FOREIGN KEY(crewID) REFERENCES crew(crewID)
);
